pragma solidity ^0.8.24;
import "@fhevm/solidity/lib/TFHE.sol";
contract FHE_Xor {
    function bitwiseXor(einput _a, bytes calldata _proofA, einput _b, bytes calldata _proofB) public {
        euint32 a = TFHE.asEuint32(_a, _proofA);
        euint32 b = TFHE.asEuint32(_b, _proofB);
        euint32 result = TFHE.xor(a, b);
        TFHE.allow(result, msg.sender);
    }
